DROP TABLE IF EXISTS `off_pro`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `off_pro` (
  `offId` varchar(50) NOT NULL,
  `offBarCode` varchar(10) NOT NULL,
  `offNum` varchar(100) NOT NULL,
  `offName` varchar(100) NOT NULL,
  `offDevVersion` varchar(100) NOT NULL,
  `offPrice` float DEFAULT NULL,
  `offObtDate` date NOT NULL,
  `offUseDepart` varchar(100) NOT NULL,
  `offUser` varchar(100) NOT NULL,
  `offManager` varchar(100) NOT NULL,
  `offRemark` varchar(100) DEFAULT NULL,
  `offUseState` varchar(100) NOT NULL,
  `offState` varchar(100) NOT NULL,
  `offSeqNum` varchar(100) NOT NULL,
  `loginuserName` varchar(50) NOT NULL,
  `offUpdTime` varchar(255) NOT NULL,
  PRIMARY KEY (`offId`),
  KEY `FK_Reference_4` (`loginuserName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

